import { useState, useEffect } from "react";

function ItemsList({ pokemon }) {
  const [pokemonItem, setPokemonItem] = useState([]);

  useEffect(() => {
    console.log('9999999');
    pokemon.map((p) =>
      fetch(`https://pokeapi.co/api/v2/pokemon/${p}`)
        .then((response) => console.log(response.json()))
        .then((data) => {
          data.sprites && setPokemonItem(data.sprites.map((sprit) => sprit.front_default));
          console.log('!!!!!!!!');
        })
    );
  }, []);

  console.log("pokemonItem", pokemonItem);

  return (
    <div>
      {pokemon.map((p) => (
        <div key={p}>{p}</div>
      ))}
    </div>
  );
}

export { ItemsList };
